import { AppBar, Toolbar, styled } from '@mui/material';
import React from 'react';

const Header = styled(AppBar)`
background:#111111
`
const Tabs = styled('p')`
    font-size:20px
`


const AdminNavBar = () => {
    return(

        <Header>
            <Toolbar>
                <p>View Users</p>
                <p>Create Submission Types</p>
                <p>Allocate Panel Members</p>
                <p>Create Marking Scheme</p>
                <p>Upload</p>
            </Toolbar>
        </Header>  
      )
}

export default AdminNavBar;
